import React from "react";
import '../App.css';
import RickRoll from "../components/buttons/rickrollButton";

function Homepage() {
  return (
    <div className="homepage">
      <header>
        <h1>Welcome Wizards</h1>
      </header>
      <main>
        <p>Together we can spread spells and misinformation.</p>
      </main>



      <img
        src={'./assets/images/photoshopped_logo/logo.png'}
        alt="" // Empty string for decorative images
        style={{
            width: '200px', // Adjust the width to a reasonable size
            height: '200px', // Adjust the height to a reasonable size
        }}
        />


    </div>
  );
}

export default Homepage;
